6081525000\",\"contents\":\"Hill completed 18 of 23 pass attempts for 233 yards, adding 10 rushes for 51 yards and two touchdowns during Sunday's 24-9 win against the Falcons. He also lost one fumble.\",\"analysis\":\"With Drew Brees (ribs) potentially out through Week 15, Coach Sean Payton elected not to turn to Jameis Winston and his 80 career starts against Atlanta. Instead, he entrusted the swiss-army knife talent Hill in his quarterback slot. On fantasy servers where Hill maintained tight end eligibility for Week 11, he proved to be an absolute gold mine. Even if entrusted in a QB slot, however, the BYU product still cashed in with his 284 scrimmage yards and two scores. His positional eligibility will be revisited after the Week 11 slate, but he offers tremendous upside with his rushing acumen heading into a matchup against the Broncos.\",\"title\":\"Effective in starting QB debut\"},{\"timeEpochMilli\":\"1606060026000\",\"contents\":\"New Orleans Saints quarterback Taysom Hill was confirmed as the starting signal-caller by head coach Sean Payton ahead of the Week 11 contest with the Falcons. In typical Payton fashion, New Orleans waited until two hours before kickoff to officially announce the starter, but the mind games are finally over. Reports had suggested that Hill would be the starter, though it's always nice to get the official word. It's anyone's guess how the 30-year old will do, as he's very unproven as a passer. ...\",\"url\":\"https://www.rotoballer.com/player-news/taysom-hill-confirmed-as-starting-quarterback/806713\",\"title\":\"Taysom Hill Confirmed As Starting Quarterback\"}],\"nameFirst\":\"Taysom\",\"nameLast\":\"Hill\",\"proTeam\":{\"abbreviation\":\"NO\",\"location\":\"New Orleans\",\"name\":\"Saints\"},\"positionEligibility\":[\"QB\",\"WR\"]},\"requestedGames\":[{\"game\":{\"id\":6304,\"away\":{\"abbreviation\":\"ATL\",\"location\":\"Atlanta\",\"name\":\"Falcons\"},\"home\":{\"abbreviation\":\"NO\",\"location\":\"New Orleans\",\"name\":\"